<!DOCTYPE html>
<html>
<head>
  <meta charset="utf-8">
  <meta content="#ffffff" name="theme-color">
  <meta content="IE=edge" http-equiv="X-UA-Compatible">
  <meta content="width=device-width,initial-scale=1.0" name="viewport">
  <title></title>
  <!--@formatter:off-->
  <!--suppress CssUnusedSymbol-->
  <style>body{background-color:#f1f1f1}body.dark{background-color:#2b2b2b}</style>
  <!--@formatter:on-->
  <link href="" rel="icon">
  <!--suppress HtmlUnknownTarget-->
  <link href="<%= BASE_URL %>assets/config.js" rel="preload" as="script">
</head>
<body>
<noscript>
  <strong>
    We're sorry but this application doesn't work properly without JavaScript enabled. Please enable it to continue.
  </strong>
</noscript>
<div id="app"></div>
<!--@formatter:off-->
<!--suppress JSUnresolvedVariable, JSUnresolvedFunction, CommaExpressionJS, ES6ConvertVarToLetConst-->
<script>!function(){var e="v-no<%= VUE_APP_PUBLIC_PATH %>",t=localStorage.getItem(e+"dark"),n=localStorage.getItem(e+"zen"),o=t?n?"#2b2b2b":"#3b3b3b":n?"#efefef":"#ffffff";document.querySelector("meta[name=theme-color]").setAttribute("content",o);var a=document.body.classList;t?a.add("dark"):a.remove("dark"),n?a.add("zen"):a.remove("zen")}()</script>
<!--@formatter:on-->
<!--suppress HtmlUnknownTarget-->
<script src="<%= BASE_URL %>assets/config.js"></script>
<!--built files will be auto injected-->
</body>
</html>
